import React from "react";

const Slot =()=>{

    let x="游때";
    let y="游때";
    let z="hii";
    
    if(x===y && y===z){
return(
    <>
    <div>
        <h1>{x} {y}{z}</h1>
        <h1>this is matching</h1>
        <hr></hr>
    </div>
    
    </>
)
    }
    else{
        return(
            <>
            <div>
                <h1>{x} {y}{z}</h1>
                <h1>this is notmatching</h1>
                <hr></hr>
            </div>
            
            </>
        )
    }


}

export default Slot;
